import Typography from "@mui/material/Typography";

import axios from "axios";

import { useEffect, useState } from "react";

import * as React from "react";

function ListAllEntries() {
  const [data, setData] = useState([]);
  useEffect(async () => {
    axios.get("http://localhost:9001/entries/all").then((res) => {
      const threads = res;
      setData(threads);
    });
  }, []);

  const getPayloadData = (res) => (
    <Typography align="left" variant="caption" paragraph component="div">
      <h>.</h>
      <pre>{JSON.stringify(res.data, null, 2)}</pre>
    </Typography>
  );

  return (
    <div>
      <h1 align="center">API Messages Payload</h1>
      <div>{getPayloadData(data)}</div>
    </div>
  );
}
export default ListAllEntries;
